import React from "react";
import "./Fashion.css";

function Fashion() {
  return (
    <div className="fashion-1">
      <img
        className="mdiclothes-hanger"
        src="https://anima-uploads.s3.amazonaws.com/projects/6492c55c74995fc792d0df14/releases/6493fbc959e3e5a943ada352/img/mdi-clothes-hanger.svg"
        alt="mdi:clothes-hanger"
      />
    </div>
  );
}

export default Fashion;
